import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from '.~/pages/Home';
import Product from '.~/pages/Product';

function App() {
    return (
        <Router>
            <div className="App">
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/product" element={<Product />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
